INSERT INTO `feedback` VALUES (1,'U23435','test','2024-12-03 18:29:30',NULL),(2,'U23435','test','2024-12-03 18:32:18',NULL),(3,'U23435','test','2024-12-03 18:32:25',NULL),(4,'U23435','test','2024-12-03 20:54:19',NULL),(5,'U23435','test','2024-12-03 21:35:38',NULL),(6,'T50396','test','2024-12-03 21:45:25',NULL),(7,'T52166','Ohne Harmonisch','2024-12-05 08:49:13',NULL),(8,'T50302','test','2024-12-05 09:05:44',NULL),(9,'P38905','test','2024-12-05 17:07:02','Basierend auf dem bereitgestellten Feedback und unter Berücksichtigung der Möglichkeit zur Verbesserung des Werbetextes, könnte der überarbeitete Text wie folgt aussehen:\n\n---\n\nEleganz und Robustheit vereint – der Sincro Dining Tisch setzt in jedem Essbereich ein modernes Statement.\n\n**Perfekte Verschmelzung von Stil und Langlebigkeit** | Der Sincro Dining Tisch beeindruckt mit seinem pulverbeschichteten Aluminiumgestell in einem dezenten Matt-Anthrazit. Diese Mischung aus anspruchsvollem Design und solider Stabilität macht ihn zur idealen Ergänzung für ein stilvolles Zuhause.\n\n**Zeitgemäßes Design** | Die Tischplatte, gefertigt aus widerstandsfähiger Keramik in einem zeitlosen washed grey, verleiht dem Sincro Dining Tisch nicht nur einen edlen Look, sondern garantiert auch höchste Resistenz gegenüber den täglichen Abnutzungen.\n\n**Wetterbeständig und standfest** | Hochwertige Edelstahlschrauben und unauffällige schwarze Kunststoff-Fußkappen gewährleisten nicht nur dauerhafte Beständigkeit, sondern auch sichere Stabilität. Dieses Design ist optimiert für eine lange Lebensdauer und für den Einsatz im Außenbereich.\n\n**Hervorragende Vielseitigkeit** | Mit seinen großzügigen Maßen von 200x100 cm bietet dieser Tisch genügend Raum für gesellige Zusammenkünfte, egal ob stilvolle Abendessen im Freien oder in Ihrem Esszimmer.\n\nErleben Sie mit dem Sincro Dining Tisch die perfekte Symbiose aus Design und Funktionalität – und gestalten Sie eine Atmosphäre, die keine Wünsche offenlässt!\n\n---\n\nDiese Version legt wert darauf, den Tisch als Zentrum von Stil und Funktionalität darzustellen und betont die Langlebigkeit sowie Vielseitigkeit in einer zeitgemäßen und stilvollen Weise.'),(10,'P38905','Lasse den letzten Satz weg','2024-12-05 17:07:30','Hier ist der überarbeitete Werbetext ohne den letzten Satz, basierend auf dem Feedback:\n\nElegant und robust zugleich – der Sincro Dining Tisch verwandelt jeden Essbereich in eine moderne Oase.\n\n**Stilvoll und langlebig** | Der Sincro Dining Tisch besticht durch sein pulverbeschichtetes Gestell aus Aluminium in matt anthrazit. Diese Kombination aus Eleganz und Stabilität macht ihn zur perfekten Wahl für jedes stilbewusste Zuhause.\n\n**Modernes Design** | Die Tischplatte aus kratzfester Keramik in einem modernen washed grey schafft nicht nur einen eleganten Look, sondern bietet auch höchste Widerstandsfähigkeit gegen alltägliche Beanspruchungen.\n\n**Wetterfest und stabil** | Rostfreie Edelstahlschrauben in glänzendem Silber und schwarz unauffällige Kunststoff-Fußkappen sichern nicht nur dauerhaften Schutz, sondern sorgen auch für einen stabilen Stand. Dieses Design ist optimal für langlebigen Einsatz konzipiert.\n\n**Perfekte Vielseitigkeit** | Mit seinem großzügigen Maß von 200x100 cm bietet der Tisch ausreichend Platz für gesellige Zusammenkünfte und stilvolle Abendessen im Freien oder in Ihrem Esszimmer.'),(11,'P38905','Lasse den letzten Satz weg','2024-12-05 17:07:37','Hier ist der überarbeitete Werbetext basierend auf dem Feedback:\n\nElegant und robust zugleich – der Sincro Dining Tisch verwandelt jeden Essbereich in eine moderne Oase.\n\n**Stilvoll und langlebig** | Der Sincro Dining Tisch besticht durch sein pulverbeschichtetes Gestell aus Aluminium in matt anthrazit. Diese Kombination aus Eleganz und Stabilität macht ihn zur perfekten Wahl für jedes stilbewusste Zuhause.\n\n**Modernes Design** | Die Tischplatte aus kratzfester Keramik in einem modernen washed grey schafft nicht nur einen eleganten Look, sondern bietet auch höchste Widerstandsfähigkeit gegen alltägliche Beanspruchungen.\n\n**Wetterfest und stabil** | Rostfreie Edelstahlschrauben in glänzendem Silber und schwarz unauffällige Kunststoff-Fußkappen sichern nicht nur dauerhaften Schutz, sondern sorgen auch für einen stabilen Stand. Dieses Design ist optimal für langlebigen Einsatz konzipiert.\n\n**Perfekte Vielseitigkeit** | Mit seinem großzügigen Maß von 200x100 cm bietet der Tisch ausreichend Platz für gesellige Zusammenkünfte und stilvolle Abendessen im Freien oder in Ihrem Esszimmer.'),(12,'M29424','Lösche den letzten Satz','2024-12-06 08:43:18','Silva Tisch 220x100cm | Keramik wood-grey\n\nZeitlos modern | Der Silva Tisch präsentiert sich in stilvollem Design mit einem pulverbeschichteten Aluminiumgestell in matt anthrazit, das in jedem Raum Akzente setzt. Als gelungene Verschmelzung von Eleganz und Zweckmäßigkeit vermittelt dieser Tisch ein modernes und zugleich wohnliches Ambiente.\n\nFederleicht stabil | Gefertigt aus hochwertigem Aluminium, bleibt das Gestell trotz seiner Leichtigkeit stabil und widerstandsfähig. Die robuste Pulverbeschichtung gewährleistet Langlebigkeit und Beständigkeit gegen die Elemente, während die edel in silber gehaltenen Edelstahlschrauben jedem Deckenelement einen eleganten Touch verleihen.\n\nNatürlich widerstandsfähig | Die rechteckige Tischplatte aus langlebiger Keramik in wood grey verbindet natürliche Ästhetik mit extremer Strapazierfähigkeit. Mit einer Stärke von 10mm trotzt sie den Herausforderungen des Alltags und ist kratzresistent – ideal, um auch draußen im Garten oder auf der Terrasse einen optimalen Einsatz zu finden.\n\nSchutzvoller Komfort | Der Silva Tisch wird durch kunststoffene Fußkappen in neutralem Schwarz vollendet, die nicht nur Schutz bieten, sondern auch elegant wirken. Sie sorgen für einen festen Stand ohne unerwünschte Kratzer auf empfindlichen Untergründen.'),(13,'T52165','Lösche den letzten Satz','2024-12-06 11:56:09','Clifton Ecktisch | Sinter Stone\n\nEleganz und Leichtigkeit | Der Clifton Ecktisch besticht durch sein matt anthrazit pulverbeschichtetes Aluminiumgestell, das nicht nur ein ästhetisches Highlight in jedem Raum setzt, sondern auch durch seine Leichtigkeit überzeugt. Lassen Sie Ihren Wohnbereich in neuem Glanz erstrahlen!\n\nSchutz und Beständigkeit | Die Tischplatte aus robustem, dunkelgrauem gesintertem Stein ist nicht nur edel und widerstandsfähig, sondern auch perfekt für alle Herausforderungen des Alltags gewappnet. Ergänzt wird der Tisch durch glänzende Edelstahlschrauben, die Korrosion keine Chance lassen.\n\nSanft und Unaufdringlich | Dank stoßdämpfenden Kunststoff-Fußkappen in unaufdringlichem Anthrazit bleiben Ihre Böden makellos geschützt. Der Clifton Ecktisch verbindet stilvolle Raffinesse mit praktischer Langlebigkeit, ideal für Innenräume und überdachte Außenbereiche.'),(14,'T52166','´Lösche den letzten Satz','2024-12-07 16:30:27','Clifton Beistelltisch | FSC-zertifiziert\n\nElegant & Leicht | Der Clifton Beistelltisch beeindruckt mit seinem modernen Design und den matt anthrazit pulverbeschichteten Aluminiumbeinen. Dieses hochwertige Gestell verleiht dem Tisch eine zeitlose Eleganz und macht ihn außergewöhnlich leicht und gut transportierbar.\n\nZeitlos & Widerstandsfähig | Die Tischplatte aus natürlichem Teakholz mit einer Stärke von 12mm bietet eine widerstandsfähige und langlebige Oberfläche, die jedem Raum oder Garten das gewisse Etwas verleiht. Dieses edle Material trotzt den Elementen und bleibt über Jahre hinweg schön.\n\nRobust & Sicher | Die stilvollen Fußkappen aus anthrazitfarbenem Kunststoff bieten schützenden Halt und bewahren empfindliche Oberflächen vor Kratzern. Silberne Edelstahlschrauben sorgen für Korrosionsbeständigkeit und runden das Gesamtbild mit einem dezenten Glanz ab.'),(15,'T52164','Bitte lösche den letzten Satz','2024-12-12 10:35:06','**Clifton Ecktisch | FSC-zertifiziert**\n\nElegante Leichtigkeit | Der Clifton Ecktisch vereint modernes Design mit rustikalem Charme. Das pulverbeschichtete Alugestell in subtil mattiertem Anthrazit besticht durch seine ästhetische Eleganz und mühelose Leichtigkeit.\n\nLanglebig und robust | Die Teakholz-Tischplatte in natürlicher Optik ist nicht nur stabil und witterungsbeständig, sondern verleiht jedem Raum ein gemütliches, rustikales Ambiente. Die 12mm starke Platte hält allen Alltagsbelastungen stand und bietet einen erdigen Kontrast zum modernen Gestell.\n\nKorrosionsbeständig | Hochwertige Edelstahlschrauben in stilvollem Silber gewährleisten eine dauerhafte und korrosionsbeständige Verbindung - somit bleibt der Tisch stets standfest und sicher.\n\nSchützende Details | Unauffällige anthrazitfarbene Fußkappen aus kratzfestem Kunststoff schützen jeden Bodenbelag und runden das durchdachte Gesamtdesign ab.\n\nEntdecke die perfekte Ergänzung für stilvolle Innen- und Außenbereiche mit dem Clifton Ecktisch. Setze auf Design und Qualität!'),(16,'P38906','Schreibe die einzelenen Abschnitte kürzer','2024-12-12 11:09:26','EDV-Nummer: P38906\n\nSincro Tisch | Keramik wood-grey\n\nZeitloses Design | Der Sincro Tisch besticht durch seine elegante Schlichtheit. Das anthrazitfarbene Aluminiumgestell ist leicht, wetterfest und langlebig dank Pulverbeschichtung.\n\nNatürliche Eleganz | Die 10 mm dicke Keramikplatte in wood grey verleiht dem Tisch einen natürlichen Look. Sie ist kratzfest und wetterbeständig – ideal für den täglichen Gebrauch.\n\nSicherer Stand | Schwarze Kunststoff-Fußkappen schützen Böden und sorgen für Stabilität auf jedem Untergrund.\n\nLanglebige Qualität | Rostfreie Edelstahlschrauben verbinden das Gestell robust und sicher. Hochwertige Materialien versprechen langjährige Freude.\n\nDer Sincro Tisch kombiniert Funktionalität mit ästhetischer Raffinesse – perfekt für gesellige Abende oder elegante Dinnerpartys. Ein Muss für jeden modernen Wohnraum.'),(17,'F13669','Lösche den letzten Satz','2024-12-13 12:15:43','### Bio-Anzuchttöpfe | Rundum nachhaltig & praktisch\n\n**Fördert optimales Wachstum** | Unsere quadratischen Bio-Anzuchttöpfe mit einem Durchmesser von 5 cm bieten die ideale Umgebung für Ihre Jungpflanzen. Perfekt für die Anzucht von Gemüse, Kräutern und Blumen, fördern sie ein gesundes Wurzelwachstum, sodass Ihre Pflanzen von Beginn an stark und widerstandsfähig heranwachsen.\n\n**100% biologisch abbaubar** | Die Töpfe bestehen aus natürlichen Materialien und sind vollständig kompostierbar. Dadurch können Sie sie einfach mitsamt der Pflanze in den Boden einpflanzen, ohne den Wachstumsprozess zu unterbrechen – für eine umweltfreundliche Gartenarbeit ohne Plastikabfall.\n\n**Platzsparendes Design** | Dank ihrer quadratischen Form lassen sich die Töpfe dicht aneinander reihen, was den verfügbaren Platz optimal ausnutzt. Ob auf dem Balkon, der Terrasse oder im Gewächshaus – Sie können auf kleinem Raum eine Vielzahl an Pflanzen ziehen.\n\nEntdecken Sie die perfekte Balance zwischen Nachhaltigkeit und Praktikabilität mit unseren Bio-Anzuchttöpfen, die Ihre Gartenarbeit revolutionieren werden!'),(18,'F13669','Lösche den letzten Satz','2024-12-13 12:15:44','### Bio-Anzuchttöpfe | Rundum nachhaltig & praktisch\n\n**Fördert optimales Wachstum** | Unsere quadratischen Bio-Anzuchttöpfe mit einem Durchmesser von 5 cm bieten die ideale Umgebung für Ihre Jungpflanzen. Sie sind perfekt für die Anzucht von Gemüse, Kräutern und Blumen und fördern ein gesundes Wurzelwachstum, sodass Ihre Pflanzen von Beginn an stark und widerstandsfähig heranwachsen.\n\n**100% biologisch abbaubar** | Die Töpfe bestehen aus natürlichen Materialien und sind vollständig kompostierbar. Das bedeutet, dass Sie sie einfach mitsamt der Pflanze in den Boden einpflanzen können, ohne den Wachstumsprozess zu unterbrechen – für eine umweltfreundliche Gartenarbeit ohne Plastikabfall.\n\n**Platzsparendes Design** | Dank ihrer quadratischen Form lassen sich die Töpfe dicht aneinander reihen, was den verfügbaren Platz optimal ausnutzt. Ob auf dem Balkon, der Terrasse oder im Gewächshaus – Sie können auf kleinem Raum eine Vielzahl an Pflanzen ziehen.\n\nEntdecken Sie die perfekte Balance zwischen Nachhaltigkeit und Praktikabilität mit unseren Bio-Anzuchttöpfen! Machen Sie Ihren grünen Daumen glücklich und pflanzen Sie mit gutem Gewissen!'),(19,'F13669','Lösche den letzten Satz','2024-12-13 12:15:50','### Bio-Anzuchttöpfe | Rundum nachhaltig & praktisch\n\n**Fördert optimales Wachstum** | Unsere quadratischen Bio-Anzuchttöpfe mit einem Durchmesser von 5 cm bieten die ideale Umgebung für Ihre Jungpflanzen. Sie sind perfekt für die Anzucht von Gemüse, Kräutern und Blumen und fördern ein gesundes Wurzelwachstum, sodass Ihre Pflanzen von Beginn an stark und widerstandsfähig heranwachsen.\n\n**100% biologisch abbaubar** | Die Töpfe bestehen aus natürlichen Materialien und sind vollständig kompostierbar. Das bedeutet, dass Sie sie einfach mitsamt der Pflanze in den Boden einpflanzen können, ohne den Wachstumsprozess zu unterbrechen – für eine umweltfreundliche Gartenarbeit ohne Plastikabfall.\n\n**Platzsparendes Design** | Dank ihrer quadratischen Form lassen sich die Töpfe dicht aneinander reihen, was den verfügbaren Platz optimal ausnutzt. Ob auf dem Balkon, der Terrasse oder im Gewächshaus – Sie können auf kleinem Raum eine Vielzahl an Pflanzen ziehen.\n\nEntdecken Sie die perfekte Balance zwischen Nachhaltigkeit und Praktikabilität mit unseren Bio-Anzuchttöpfen! Machen Sie Ihren grünen Daumen glücklich und pflanzen Sie mit gutem Gewissen!'),(20,'P37184','Die Schrauben sind nicht glänzend und die Tischplattengröße ist nicht relevant','2024-12-18 15:09:51','**Sincro Teak Tisch – Ihr idealer Begleiter für den Außenbereich**\n\nModerne Eleganz | Der Sincro Teak Tisch besticht durch ein stilvolles Gestell aus pulverbeschichtetem Aluminium in matt anthrazit, das modernes Design mit erstklassiger Funktionalität kombiniert. Leicht und trotzdem langlebig, ist dieser Tisch die perfekte Wahl für jedes Outdoor-Erlebnis.\n\nNatürliche Wärme | Die Tischplatte aus FSC® 100% zertifiziertem Teakholz in einem warmen Naturton strahlt einladende Gemütlichkeit aus. 10mm stark und rechteckig, überzeugt sie mit Stabilität und einem umweltfreundlichen Charme.\n\nLangfristige Beständigkeit | Hochwertige Edelstahl-Schrauben garantieren Rostfreiheit und Langlebigkeit. Ergänzt durch dezente schwarze Fußkappen aus Kunststoff, schützen sie Ihre Bodenbeläge sanft und zuverlässig.\n\nZeitloser Luxus | Verleihen Sie Ihrem Außenbereich mit dem Sincro Teak Tisch einen Hauch von zeitlosem Luxus. Egal, ob für ein gemütliches Frühstück im Freien oder ein stilvolles Abendessen unter dem Sternenhimmel – dieser Tisch ist die ideale Ergänzung für Ihren Garten.'),(21,'R07994','Unsere Edelstahlschrauben in silber sind korrosionsbeständig und modern, was eine einfache Pflege und eine verlängernde Lebensdauer sichert. Schwarze Kunststoff-Fußkappen schützen Ihre Böden und runden das Set unauffällig ab.\r\n\r\nDie Farbe ist nicht relevant, bitte lasse sie weg ','2024-12-19 07:55:01','**Roma Lounge Set | Eleganz und Komfort für Ihren Außenbereich**\n\nZeitloser Stil | Das Roma Lounge Set besticht durch sein elegantes Design. Mit seinem leichten Aluminiumgestell und dem hochwertigen Gardino®-Geflecht fügt es sich harmonisch in jede Umgebung ein und strahlt zeitlose Eleganz aus.\n\nRobuste Materialien | Der Bezug aus strapazierfähigem Polypropylen ist mit 280 g/m² besonders robust. Das wetterfeste Gardino®-Geflecht und das pulverbeschichtete Aluminiumgestell versprechen langlebige Beständigkeit, sodass Sie jahrelang Freude an Ihrem Outdoor-Möbel haben werden.\n\nKomfort inklusive | Das Lounge Set kommt mit komfortablen Sitz- und Rückenkissen, die Entspannung pur garantieren. Die stilvollen Teakholz-Armlehnen, FSC® 100% zertifiziert, bieten natürlichen Halt und betonen die hochwertige Verarbeitung.\n\nPflegeleichte Details | Unsere korrosionsbeständigen Edelstahlschrauben sichern eine einfache Pflege und verlängerte Lebensdauer. Schwarze Kunststoff-Fußkappen schützen Ihre Böden und runden das Set unauffällig ab.\n\nFür stilbewusste Genießer | Ob für gemütliche Abende mit Freunden oder entspannte Stunden allein – das Roma Lounge Set vereint Funktionalität mit edlem Design und schafft Ihre persönliche Wohlfühloase im Freien. Erleben Sie den Luxus der Beständigkeit bei höchsten Komfortansprüchen!');
