INSERT INTO `stilbeispiele` VALUES (1,1,'Sincro Ausziehtisch | Keramik washed-grey\nBequem erweiterbar | Der Synchron-Ausziehmechanismus lässt sich einfach mit einer Hand bedienen und erweitert den Tisch automatisch zu beiden Seiten von 2m auf 2,60m. Mit diesem modernen Gartentisch bist du auf jeden Anlass vorbereitet.\nKratzresistent | Die Tischplatte aus hellen Keramikfliesen ist extrem unempfindlich und kratzresistent und trotzt auch Witterungseinflüssen wie Regen und Frost. So ist der Tisch wunderbar outdoor-geeignet.\n...');
