INSERT INTO `werbetexte` VALUES (1,'380831','Entdecken Sie die ultimative Kombination aus Form und Funktion mit unserer einzigartigen EDV-Nummer 380831. Mit einer elegant schimmernden Gestellfarbe und dem langlebigen Gestellmaterial auf dem modernsten Stand, bietet unsere \"stilvoll\" Serie ein robustes und dennoch attraktives Design. \n\nVervollständigen Sie Ihr Wohnambiente mit einem Möbelstück, das nicht nur funktional, sondern auch strapazierfähig und dekorativ ist. Die hochwertigen Materialien treffen auf eine künstlerische Flächenfarbe, die Ihr Zuhause in ein wahres Kunstwerk verwandelt. Mit schützendem Fußkappenmaterial ausgestattet, wird der Boden geschont, während der Stil perfekt beibehalten wird.\n\nDieses Meisterwerk erfüllt höchste Ansprüche, ohne auf ein Zertifikat angewiesen zu sein. Die perfekt inszenierte Verschmelzung von Qualität und Ästhetik macht unser Produkt zu einem unverzichtbaren Begleiter in jeder stilvollen Einrichtung! Tauchen Sie ein in eine Welt voller Eleganz und Langlebigkeit – willkommen in der Zukunft des stilvollen Wohnens.'),(2,'380831','? Willkommen in der Welt der Perfektion! ?\n\nEntdecken Sie das neueste Meisterwerk der Eleganz – unser \"Stil\" Chair! Mit der EDV-Nummer 380831 bringt dieses Möbelstück nicht nur Funktionalität, Design und Ästhetik in Ihr Zuhause, sondern auch einen Hauch von Luxus. \n\n✨ Warum Sie unseren \"Stil\" Chair lieben werden:\n\n- **Elegantes Gestell**: Erleben Sie die faszinierende Kombination aus robustem Gewicht und langlebigem Gestellmaterial, das jede Umgebung aufwertet.\n- **Hochwertige Materialien**: Von dekorativer Flächenfarbe bis hin zu schützendem Fußkappenmaterial – alles wurde mit Bedacht gewählt.\n- **Standard-Zertifizierung**: Qualität auf die Sie sich verlassen können, durch unser Standardzertifikat.\n\nBereiten Sie sich darauf vor, in einer Umgebung zu entspannen, die nicht nur funktional, sondern auch ein visueller Genuss ist. Bringen Sie einen Hauch Raffinesse in Ihr Zuhause – mit dem \"Stil\" Chair, wo Funktionalität auf Design und Ästhetik trifft. ?️✨\n\nSeien Sie bereit, bewundernde Blicke zu ernten und genießen Sie das Beste in Inneneinrichtung! ?\n\nWerden Sie Teil des neuen Standards in Sachen Einrichtungsdesign. Nehmen Sie Platz in Ihrem \"Stil\" Chair und erleben Sie selbst, wie Eleganz und Funktionalität jeden Raum erheben können!\n\nJetzt verfügbar – sichern Sie sich Ihren \"Stil\" Chair und geben Sie Ihrem Zuhause den Glanz, den es verdient. ??'),(3,'507052','Introducing the ultimate combination of style and durability – our exclusive furniture piece, product code 507052!\n\nImagine a masterpiece where modern aesthetics meet robust construction. With a sleek and shiny frame that glistens with elegance, this piece is crafted from materials that promise longevity and resilience. The refined finishes of the surface are as elegant as they are practical, offering a touch of sophistication that is effortlessly timeless.\n\nWhether you\'re hosting a dinner party or enjoying a quiet evening at home, this piece is more than just furniture; it\'s an experience of beauty and strength intertwined. Its robust and glossy frame not only ensures stability but also emanates a modern charm that enhances any space.\n\nElevate your living area with a piece that reflects your taste for sophistication, elegance, and lasting quality. Transform your interior with the perfect blend of form and function – where every detail is meticulously designed to meet your high standards.\n\nDiscover furniture that\'s as enduring as it is beautiful, and let your home speak volumes of your exquisite taste with EDV-Nummer: 507052.'),(4,'507052','Entdecken Sie das Schmuckstück Ihrer Einrichtung – unser exklusives Modell mit der EDV-Nummer 507052! \n\nDieses Möbelstück vereint Eleganz und Langlebigkeit in einer perfekten Symbiose. Das geschmackvolle, elegante Gestell besticht durch robustes Material und eine glänzende Behandlung, die jedem Raum einen stilvollen Glanz verleiht. Die moderne Flächenfarbe ergänzt das anspruchsvolle Design und verleiht Ihrem Zuhause eine frische, zeitlose Ausstrahlung. \n\nErleben Sie die Balance zwischen Stil und Funktionalität und lassen Sie sich von der Qualität überzeugen, die auf den ersten Blick sichtbar ist. Dieses Möbelstück ist mehr als nur ein Gebrauchsgegenstand – es ist ein Statement für anspruchsvolle Wohnkultur. \n\nGönnen Sie Ihrem Zuhause das gewisse Etwas und setzen Sie auf ein Design, das genauso langlebig ist wie es beeindruckend aussieht. Holen Sie sich jetzt die moderne Eleganz ins Haus und genießen Sie jeden Blick auf dieses außergewöhnliche Stück.'),(5,'120555','Entdecken Sie das zeitlose Schmuckstück für Ihr Zuhause: Unser exklusives Designer-Möbelstück mit der EDV-Nummer 120555! \n\nTauchen Sie ein in die perfekte Symbiose aus Natur und Nachhaltigkeit. Die natürliche Farbgebung und das umweltfreundliche Design vereinen sich harmonisch in einem Gestell aus nachhaltig gewonnenem Material. Werten Sie Ihre Wohnräume auf mit einer Oberfläche, die nicht nur hochwertig, sondern auch außergewöhnlich strapazierfähig ist – gemacht, um den Herausforderungen des Alltags zu trotzen.\n\nUnsere Armlehnen, ebenfalls in natürlichem Farbton gehalten, bieten Ihnen dank ihrer umweltfreundlichen Materialien nicht nur Komfort, sondern auch ein gutes Gewissen. Der minimalistische Charakter der Kissen schafft eine einladende Atmosphäre voller Ruhe und Stil.\n\nNicht zu vergessen: die robusten, metallischen Schrauben, deren witterungsbeständige Behandlung für dauerhafte Stabilität sorgt. Alles an diesem Möbelstück ist darauf ausgelegt, Ihnen über viele Jahre hinweg Freude zu bereiten.\n\nLassen Sie sich von der Kombination aus natürlicher Schönheit, Langlebigkeit und umweltbewusstem Design überzeugen. Bringen Sie mit diesem einzigartigen Möbelstück Natürlichkeit und Eleganz in Ihren Wohnbereich – nachhaltig und edel zugleich. \n\nVerwandeln Sie jeden Raum in Ihr persönliches Paradies!'),(6,'120555','Erleben Sie zeitloses Design und unvergleichliche Qualität mit unserer exklusiven Möbellinie, EDV-Nummer: 120555. Jedes Detail dieses Meisterstücks spricht für sich:\n\nUnser in natürlichem Ton gehaltenes Gestell besteht aus nachhaltigen Materialien, die nicht nur gut aussehen, sondern auch für Langlebigkeit sorgen. Die Flächen aus hochwertigem Material strahlen in naturbelassenem Look und sind so strapazierfähig, dass sie den Herausforderungen des Alltags mühelos standhalten.\n\nErgonomische, unbehandelte Armlehnen aus stabilem Material versprechen eine pflegeleichte Handhabung und ein Erlebnis von bequemer Eleganz. Gleichzeitig setzen die auffälligen, korrosionsbeständig behandelten Schrauben smarte Akzente und garantieren robuste, langlebige Verbindungen.\n\nGenießen Sie ein Möbelstück, das mit seinem zeitlosen Ambiente und langlebigen Design überzeugt. Unsere Möbelstücke werden ohne Kissen geliefert, damit Sie Ihren persönlichen Stil mit einzigartigen Akzenten gestalten können.\n\nDiese Kollektion ist der Inbegriff von Verlässlichkeit und Nachhaltigkeit. Sie verkörpert eine Philosophie, die den hohen Ansprüchen an Qualität und Design gerecht wird und Ihr Zuhause nicht nur verschönert, sondern auch seine Werte widerspiegelt. Gönnen Sie sich die Perfektion, die bleibt – entdecken Sie unsere einzigartige, natürliche Schönheit!'),(7,'M90915','? *Gönnen Sie sich den ultimativen Rückzugsort in Ihrem Zuhause!* ?\n\nTauchen Sie ein in pure Entspannung mit dem YOBAYA Hängesessel Easy Grey – Ihr persönliches Paradies in neutralen Tönen und raffinierter Eleganz. \n\n✨ **Warum der YOBAYA Hängesessel Easy Grey?**\n\n- **Stilvolles Design**: Die neutrale Bezugs- und Flächenfarbe harmonieren perfekt mit dem dunkel gehaltenen, robusten Gestell. Ein wahrer Blickfang für Ihr Zuhause, der Ruhe und Gelassenheit ausstrahlt.\n\n- **Unvergleichlicher Komfort**: Der atmungsaktive Bezug aus dichtem, strapazierfähigem Material und das bequeme Kissen laden zum Verweilen ein und bieten Komfort, den man spüren muss.\n\n- **Langlebige Qualität**: Gefertigt aus hochwertigen Materialien – das widerstandsfähige Gestell, der stabile Schraubenbau und die schützenden Fußkappen garantieren Stabilität und Schutz, der Sie lange begleiten wird.\n\n- **Widerstandsfähige Schätze**: Nicht nur die Korrosionsbeständigkeit der Schrauben, sondern auch die schonenden Fußkappen schützen Ihren Boden und tragen zur Langlebigkeit des Sessels bei.\n\nVerwandeln Sie Ihren Garten, Balkon oder Ihre Terrasse in eine Wohlfühloase und geben Sie sich dem sanften Schaukeln hin. Der YOBAYA Hängesessel Easy Grey ist nicht nur ein Möbelstück – es ist Ihr neues Lieblingswohngefühl.\n\n? Erleben Sie den Unterschied und lassen Sie sich von der Perfektion des YOBAYA Hängesessels Easy Grey begeistern! ?\n\n**Bestellen Sie jetzt und gönnen Sie sich diesen luxuriösen Hängesessel, der Ihr Zuhause verwandelt.**'),(8,'T50302','Entdecke den Cortina Hocker in elegantem Grau – dein neuer Favorit für Komfort und Stil in deinem Zuhause oder Garten!\n\n**Zeitloses Design trifft auf Funktionalität:** Die dezente Farbe des Bezugs passt sich harmonisch in jede Umgebung ein, während das moderne Gestell ein echter Hingucker ist. Genieße die robuste Bauweise, die deinem Hocker sowohl Stabilität als auch ein ansprechendes Aussehen verleiht.\n\n**Komfort ohne Kompromisse:** Das langlebige, dichte Bezugsmaterial verspricht langanhaltenden Komfort, während das wetterfeste Gestell und der schützende Fußkappen den Hocker für den Gebrauch im Freien qualifizieren. Der Bezug ist zudem pflegeleicht, sodass du mehr Zeit zum Entspannen hast.\n\n**Robuste Materialien für anspruchsvolle Nutzer:** Unser Cortina Hocker setzt auf widerstandsfähige Flächenmaterialien und eine stilvolle Armlehnenfarbe. Die korrosionsbeständigen Schrauben und die rutschfesten Fußkappen garantieren Haltbarkeit, während die glänzenden Schrauben ein edles Detail hinzufügen. \n\n**Perfekt für jedes Ambiente:** Ob auf der Terrasse oder im Wohnzimmer – der witterungsbeständige Hocker mit atmungsaktiver Fläche passt überall hin und verspricht Komfort bei jedem Einsatz. Er ist die ideale Ergänzung zu deinem Wohnstil, mit seinem stabilen, wetterfesten Gestell als Highlight.\n\nVerleihe deinem Raum das gewisse Etwas mit dem Cortina Hocker, der nicht nur optisch überzeugt, sondern auch durch seine durchdachte Materialwahl und Verarbeitung punktet!'),(9,'T88492','**Catania Dining Move Ses | Modernes Gartendesign**\n\n**Zeitloser Stil |** Dank des edlen teaklook Gestells vereint dieser Gartenstuhl eine elegante Holzoptik mit moderner Funktionalität. Die neutral graue Fläche aus wetterfestem Ranotex®-Gewebe verspricht Beständigkeit in jeder Jahreszeit.\n\n**Rostfreie Stabilität |** Das Aluminiumgestell ist nicht nur leicht und einfach zu handhaben, sondern auch rostfrei, wodurch es selbst in feuchten Umgebungen zuverlässig bleibt. \n\n**Strapazierfähiger Komfort |** Mit den klassisch anmutenden Armlehnen in teaklook, gefertigt aus Aluminium, bietet der Stuhl einen leichten und komfortablen Sitz. Die stabilisierten Fußkappen aus schwarzem Kunststoff sorgen für einen sicheren Stand und runden das zeitlose Design ab.\n\n**Schutz und Langlebigkeit |** Die folierte Gestell- und Armlehnenausführung schützt vor äußeren Einflüssen und betont die langlebige Qualität des Möbels. Die silbernen Edelstahlschrauben unterstreichen die edle Optik und garantieren zuverlässige Festigkeit.\n\nGenießen Sie Ihre Outdoor-Erlebnisse stilvoll und entspannt mit dem Catania Dining Move Ses – ein Meisterwerk der Gartenmöbelkunst, das mit jedem Detail überzeugt.'),(10,'T59859','Entdecken Sie den Kansas Din.Bank in elegantem Grau – das perfekte Zusammenspiel aus Stil und Komfort für Ihre Oase im Freien.\n\nEleganter Komfort | Der edle Bezug in einem dunklen grauen Mix aus strapazierfähigem Polyester mit einer Dichte von 245 g/m² sorgt nicht nur für eine luxuriöse Optik, sondern ist auch pflegeleicht und langlebig. Die inkludierten Sitz- und Rückenkissen versprechen höchsten Komfort und laden zum Entspannen ein.\n\nRobuste Eleganz | Das Gestell aus hochwertigem, pulverbeschichtetem Edelstahl in modernem matt Anthrazit garantiert Stabilität und Langlebigkeit. Kombiniert mit korrosionsbeständigen Edelstahlschrauben in elegantem Silber, ist dieser Bank ein wahrer Blickfang.\n\nStilvolles Design | Die stilvolle Fläche aus ansprechendem Gardino®-Geflecht in einem dekorativen, twisted Design unterstreicht den gehobenen Charakter dieses Möbelstücks. Die dunkelgraue Farbgebung fügt sich harmonisch in jede Umgebung ein.\n\nSchützende Details | Ausgestattet mit schwarzen Kunststoff-Fußkappen für zusätzlichen Schutz und eine unauffällige Optik, steht der Kansas Din.Bank sicher auf jedem Untergrund.\n\nVerwandeln Sie Ihren Außenbereich in eine stilvolle und gemütliche Entspannungsoase mit dem Kansas Din.Bank – perfekt für gesellige Abende oder erholsame Momente zu zweit.'),(11,'T50305','Entdecke die Eleganz der Natur mit der Cortina L-Move!\n\nLuxuriöses Design | Erlebe den Cortina L-Move in ihrer vollen Eleganz mit einem Bezug in edlem sandstone. Diese Lounge-Garnitur bringt den perfekten Hauch von Luxus in deinen Außenbereich und harmoniert nahtlos mit den natürlichen Elementen deiner Umgebung.\n\nRobuste und Stilvolle Ausführung | Das matt anthrazit pulverbeschichtete Aluminiumgestell bietet nicht nur Stabilität, sondern auch einen modernen Look, der deinem Garten Zeitlosigkeit verleiht. Kombiniert mit den stilvollen und naturfarbenen Kordelflächen wird die Cortina L-Move zum stilvollen Mittelpunkt deines Gartens.\n\nKomfortabel & Langlebig | Mit einem strapazierfähigen Polypropylenbezug von 370 g/m² und inklusive bequemen Auflagen sorgt die Cortina L-Move für ultimativen Komfort. Der langlebige Stoff trotzt dem täglichen Gebrauch und bleibt dabei wunderbar formstabil.\n\nNachhaltigkeit trifft Eleganz | Die glänzenden silbernen Edelstahlschrauben und dezenten schwarzen Kunststoff-Fußkappen sorgen für Korrosionsbeständigkeit und Schutz, während die nachhaltigen Teakholz-Armlehnenonlays mit FSC® 100% Zertifizierung deinem Außenbereich eine warme, natürliche Note verleihen.\n\nPerfekte Symbiose von Design und Funktionalität | Mit ihrem robusten, wetterbeständigen Materialmix und der praktischen Konstruktion ist die Cortina L-Move die ideale Wahl für alle, die auf der Suche nach einem luxuriösen, langlebigen und umweltbewussten Möbelstück für ihren Garten sind.\n\nErlebe es selbst – stilvoll und zeitlos mit der Cortina L-Move, dem ikonischen Sitzmöbel für anspruchsvolle Designliebhaber!'),(12,'T91231','**Erleben Sie elegantes Design und unübertroffene Funktionalität – der Bellani L-Ts 140x85 an/PG ist bereit, Ihren Raum zu verwandeln!**\n\n**Moderner Stil trifft auf langlebige Materialien:**\n- **Gestell in Matt Anthrazit:** Die elegante Farbgebung des pulverbeschichteten Aluminiumgestells verleiht dem Tisch eine exklusive Note, während es gleichzeitig leicht und robust ist.\n- **Stilvolle Tischplatte:** Die Keramikplatte in modernem Pinie-Grau ist nicht nur ein Hingucker, sondern auch kratzfest und perfekt für den täglichen Gebrauch geeignet.\n- **Langlebige Details:** Edle Edelstahlschrauben in glänzendem Silber sorgen für eine korrosionsbeständige Befestigung, während schwarze Kunststoffkappen die Füße schützen und Stabilität bieten.\n\n**Ein Tisch für alle Gelegenheiten:**\nPerfekt für den Innen- wie auch den Außenbereich. Der Bellani L-Ts ist Ihre stilvolle Lösung für gemeinschaftliche Mahlzeiten und genießt zudem durch seine widerstandsfähigen Materialien absolute Wetterfestigkeit. \n\nMachen Sie Ihren Wohnraum zur Design-Oase! Mit dem Bellani L-Ts 140x85 an/PG vereinen Sie Schutz, Stil und Beständigkeit auf elegante Weise. Holen Sie sich diesen eleganten Tisch noch heute und setzen Sie ein stilvolles Statement!'),(13,'T59860','**Kansas Dining Bank in Taupe – Stilvoller Komfort für Ihr Zuhause**\n\n**Natürliche Eleganz |** Lassen Sie sich von der natürlichen Optik der Kansas Dining Bank verzaubern. Der Bezug in einem Mix aus naturfarbenem Polyester, mit einer bemerkenswerten Materialdichte von 245 g/m², sorgt für eine hochwertige Optik, die sich perfekt in jede Einrichtung einfügt.\n\n**Modern und robust |** Das moderne Gestell in matt anthrazit aus pulverbeschichtetem Edelstahl garantiert eine langlebige und wetterfeste Nutzung – perfekt für den Einsatz drinnen und draußen. \n\n**Innovativer Look |** Das Gardino®-Geflecht in taupe mit seiner dekorativen Twisted-Ausführung verleiht der Bank eine stilvolle Präsenz, die in jedem Raum ein Highlight setzt.\n\n**Komfort der Extraklasse |** Genießen Sie maximalen Komfort mit den inkludierten Sitz- und Rückenkissen, die für Wohlfühlmomente beim Plaudern oder Entspannen sorgen.\n\n**Strapazierfähig und beständig |** Die Verwendung von korrosionsbeständigen Edelstahlschrauben in Silber unterstreicht die Langlebigkeit der Bank, während die unauffälligen schwarzen Kunststoff-Fußkappen für Stabilität sorgen und Ihre Böden schützen.\n\nVerleihen Sie Ihrem Essbereich oder Ihrer Terrasse mit der Kansas Dining Bank in Taupe das gewisse Extra an Stil und Komfort. Erleben Sie einen einzigartigen Mix aus natürlicher Schönheit und modernem Design!'),(14,'P57010','Tauche ein in die Welt des modernen Designs mit dem Tirana Ausziehtisch – dein eleganter Begleiter für unvergessliche Abende im Freien.\n\n### Komfortabel erweiterbar\nDank seines benutzerfreundlichen Synchron-Ausziehmechanismus lässt sich der Tisch spielend leicht mit nur einer Hand von 2m auf 2,60m erweitern. Sei bestens auf spontane Dinnerpartys oder große Familienfeiern vorbereitet.\n\n### Stilvoll und robust\nDas pulverbeschichtete Aluminiumgestell in edlem matt anthrazit verleiht deinem Außenbereich einen Hauch von Eleganz, während es gleichzeitig für Stabilität und Haltbarkeit sorgt. Die moderne Tischplatte in wood grey, gefertigt aus kratzresistenter Keramik, trotzt jedem Wetter und bleibt stets in ihrer besten Form.\n\n### Dauerhaft und widerstandsfähig\nMit rostfreien Edelstahlschrauben und schützenden schwarzen Fußkappen aus Kunststoff überzeugt der Tisch nicht nur durch seine Optik, sondern auch durch seine Langlebigkeit und Standfestigkeit. Diese Kombination macht den Tirana Ausziehtisch zu einem verlässlichen Partner für viele Sommerabende.\n\n### Unaufdringlich elegant\nDie eleganten silbernen Schrauben fügen sich nahtlos in das Gesamtdesign des Tisches ein, während die unauffälligen schwarzen Fußkappen zusätzlichen Schutz bieten und den Gesamteindruck abrunden.\n\nGestalte deine Outdoor-Umgebung mit dem Tirana Ausziehtisch – ein Meisterwerk der Moderne, das Funktionalität und Design perfekt in sich vereint.'),(15,'T50285','Entdecke den Lift Tisch 140x85 in der Farbe Wood Grey – der Inbegriff von Stil und Funktionalität für deinen Wohnraum. \n\n**Elegant in Design und Funktion**\n\n- **Zeitloser Look** | Das matt anthrazitfarbene, pulverbeschichtete Aluminiumgestell bietet einen modernen, dezenten Stil und garantiert gleichzeitig Langlebigkeit und Stabilität.\n- **Robust und Natürlich** | Die Tischplatte aus Keramik in der warmen Farbe Wood Grey verleiht deinem Raum eine harmonische Atmosphäre und ist gleichzeitig extrem robust und widerstandsfähig – ideal für den täglichen Gebrauch.\n- **Stabil und Sicher** | Die stabilisierenden, schwarzen Kunststoff-Fußkappen schützen den Boden und bieten langlebige Nutzung, gepaart mit Edelstahl-Schrauben in glänzendem Silber, die Korrosionsbeständigkeit versprechen.\n\nDieser Tisch vereint modernes Design mit widerstandsfähigen Materialien und ist der perfekte Begleiter für jede Gelegenheit【4:0†source】.'),(16,'T59649','Entdecke den Taranto Hocker in edlem Ice-Grey – dein neuer Lieblingsbegleiter für stilvolle Momente im Freien!\n\nElegant & Leicht | Das matt weiß-graue Aluminiumgestell verleiht dem Hocker eine elegante Ausstrahlung und sorgt gleichzeitig für ein geringes Gewicht. Perfekt, um deinen Raum flexibel zu gestalten.\n\nWitterungsbeständig & Pflegeleicht | Das halbrunde Gardino®-Geflecht in modernem Ice-Grey ist nicht nur ein optisches Highlight, sondern auch extrem pflegeleicht und witterungsbeständig. Egal ob bei strahlendem Sonnenschein oder unerwartetem Regenschauer – dieser Hocker hält stand.\n\nRostfrei & Langlebig | Dank der hochwertigen Pulverbeschichtung bleibt das Aluminiumgestell rostfrei und beeindruckt durch seine Langlebigkeit, was den Taranto Hocker zu einer nachhaltigen und sicheren Investition macht.\n\nMinimalistisch & Modern | Der Hocker kommt ohne Kissen aus und besticht durch sein minimalistisches Design. Die schwarzen, rutschfesten Kunststoff-Fußkappen setzen einen kontrastreichen Akzent und bieten standfeste Sicherheit auf jedem Untergrund.\n\nErlebe, wie der Taranto Hocker deinem Außenbereich eine moderne und gleichzeitig zeitlose Note verleiht – Komfort und Stil in Perfektion!'),(17,'R15573','### Square Stapelstuhl | Olive\n\n**Zeitlose Eleganz trifft auf Funktionalität**  \nEntdecken Sie den Square Stapelstuhl in der eleganten Farbe Olive. Mit seinem glasfaserverstärkten Polypropylen-Gestell bietet dieser Stuhl nicht nur eine beeindruckende Stabilität, sondern auch eine bemerkenswerte Langlebigkeit, die für den täglichen Gebrauch von unschätzbarem Wert ist.\n\n**Natürliche Farbgebung**  \nDie natürliche Oliv-Nuance verleiht Ihrem Raum eine subtile, aber eindrucksvolle Note. Perfekt für jedes Ambiente – ob drinnen oder draußen – dieser Stuhl fügt sich harmonisch überall ein.\n\n**Sanfter Schutz**  \nAusgestattet mit unauffälligen, transparenten Fußkappen, die den Boden schonen und unbemerkt bleiben, gewährleistet der Square Stapelstuhl die Erhaltung Ihres Bodens ohne Abstriche beim Design zu machen.\n\n**Minimalistisches Design**  \nGanz im Sinne eines modernen und minimalistischen Lebensstils hält sich dieser Stuhl bewusst zurück und verzichtet auf Kissen. Dabei überzeugt er gerade durch seine Schlichtheit.\n\nGönnen Sie sich die perfekte Mischung aus Stil, Stabilität und Zweckmäßigkeit mit dem Square Stapelstuhl – ein Must-have für jedes gut ausgestattete Zuhause.'),(18,'S83264','Tauro Kl-Sessel | Mat-Anthrazit\n\nElegant und Leicht | Der Tauro Kl-Sessel kombiniert ein elegantes matt anthrazitfarbenes Gestell aus leichtem Aluminium mit stilvollen Aluminiumelementen. Sein durchdachtes Design bietet Komfort und Stil in jedem Außenbereich.\n\nStrapazierfähig und Modern | Das Ranotex®-Gewebe in royal grau ist nicht nur modern, sondern auch extrem strapazierfähig und pflegeleicht. Es bietet eine perfekte Kombination aus Komfort und Widerstandsfähigkeit, ideal für jeden Außenbereich.\n\nRostfrei und Langlebig | Die rostfreien Edelstahlschrauben in glänzendem Silber sorgen für Stabilität und Langlebigkeit. Mit einer pulverbeschichteten Behandlung schützt das Gestell und die Armlehnen Ihre Investition über Jahre hinweg.\n\nUnauffällig und Schonend | Schwarze Kunststoff-Fußkappen bieten unauffälligen und schonenden Bodenschutz, sodass Sie sich keine Sorgen um Kratzer auf Ihren Terrassenböden machen müssen.\n\nGenießen Sie diesen minimalistisch gestalteten Sessel, der nicht nur ein optisches, sondern auch ein praktisches Highlight in Ihrer Gartenlandschaft ist. Effortless chic für jeden Außenbereich mit dem Tauro Kl-Sessel!'),(19,'S83264','**Tauro Kl-Sessel | Matt-Anthrazit Eleganz**\n\n**Leicht und Modern** | Mit seinem eleganten Aluminiumgestell in matt anthrazit ist der Tauro Kl-Sessel mühelos leicht und verspricht dennoch maximale Haltbarkeit. Die mit Pulverbeschichtung behandelte Oberfläche sorgt für eine beeindruckend lange Lebensdauer und schützt vor Witterungseinflüssen.\n\n**Strapazierfähig und Stilvoll** | Das Ranotex®-Gewebe in royal grau verleiht diesem Sessel nicht nur eine moderne Optik, sondern auch eine außergewöhnliche Strapazierfähigkeit. Die stilvollen Armlehnen aus Aluminium, ebenfalls in matt anthrazit, sind rostfrei und beispiellos haltbar.\n\n**Robust und Praktisch** | Mit Edelstahlverschraubungen in glänzendem Silber und praktischen Fußkappen aus schwarzem Kunststoff bietet dieser Sessel nicht nur eine stabile und robuste Bauweise, sondern ist auch unauffällig in seiner Ästhetik.\n\nTauro Kl-Sessel ist die perfekte Ergänzung für jeden modernen Raum, bietet minimalistischen Komfort ohne Kissen und hält jeder Beanspruchung stand. Ideal für stilvolle Outdoor-Bereiche und zeitgemäße Innenräume【4:0†source】.'),(20,'S83264','Tauro Kl-Sessel | Ranotex® royal-grau\n\nLeicht und Elegant | Der Tauro Kl-Sessel beeindruckt mit seinem matt anthrazit pulverbeschichteten Aluminiumgestell, das nicht nur extrem leicht, sondern auch elegant im Design ist. Perfekt angepasst für stilvolle Außenbereiche.\n\nLanglebig und Wetterbeständig | Die Oberfläche des Sessels besteht aus robustem Ranotex®-Gewebe in einem stilvollen royal-grau. Diese Materialwahl macht den Sessel besonders langlebig und wetterbeständig – ideal für den Einsatz im Freien.\n\nModern und Haltbar | Die Aluminiumarmlehnen, ebenfalls in matt anthrazit und pulverbeschichtet, versprechen nicht nur einen modernen Look, sondern auch eine lang anhaltende Haltbarkeit. Besonders hervorzuheben sind die silber glänzenden Edelstahlschrauben, die korrosionsbeständig und stabil sind.\n\nRutschfest und Schützend | Mit den schwarzen Kunststofffußkappen, die für Rutschfestigkeit und Schutz sorgen, steht dieser Sessel fest auf jeder Oberfläche, während die unauffälligen, aber praktischen Details das minimalistische Design unterstreichen.\n\nEntdecke den Unterschied, den Qualität und Design in deinem Outdoor-Bereich machen können, mit dem Tauro Kl-Sessel als perfektem Begleiter für entspannte Stunden【4:0†source】.'),(21,'R15577','**Square Stapelsessel, Grau | Zeitloses Design**\n\nVielseitig kombinierbar | Der Square Stapelsessel besticht durch sein neutrales graues Gestell, das sich harmonisch in jede Umgebung einfügt. Dank des robusten Polypropylen-Materials meistert der Sessel mühelos den täglichen Einsatz sowohl drinnen als auch draußen.\n\nExtra langlebig | Die glasfaserverstärkte Konstruktion sorgt für zusätzliche Stabilität und Widerstandsfähigkeit des Sessels. So bleibt der Square Stapelsessel über viele Jahre ein verlässlicher Begleiter im Garten oder auf der Terrasse.\n\nSchutz für empfindliche Böden | Die transparenten Kunststoff-Fußkappen bieten einen schonenden Schutz für alle Bodenarten und sind gleichzeitig unauffällig, sodass das minimalistische Design nicht gestört wird.\n\nEin minimalistisches Erlebnis | Der Verzicht auf Kissen unterstreicht das minimalistische Design und ermöglicht eine einfache Reinigung sowie Pflege. Perfekt für alle, die es schlicht und elegant mögen.'),(22,'R15577','Entdecke den eleganten Square Stapelsessel in edlem Grau – die perfekte Ergänzung für deinen stilvollen Außenbereich.\n\nZeitloser Chic | Das neutrale graue Gestell aus hochqualitativem Polypropylen besticht durch seine moderne Schlichtheit und fügt sich nahtlos in jede Umgebung ein. Sein minimalistisches Design macht diesen Stapelsessel zur idealen Wahl für eine dezente Eleganz.\n\nRobust & Langlebig | Das glasfaserverstärkte Gestell verspricht außergewöhnliche Stabilität und Langlebigkeit. Erlebe eine Möbelqualität, die auch den anspruchsvollsten Bedingungen im Freien standhält.\n\nLeicht & Praktisch | Mit dem transparenten, unauffälligen Fußkappen aus Kunststoff bleibt der Boden unbeschädigt und das Leichtgewicht ist einfach zu handhaben – ob im Einsatz oder beim Stapeln.\n\nMinimalistischer Komfort | Ohne zusätzliches Kissen erhält dieser Sessel seinen klaren, reduzierten Look. Perfekt für Liebhaber des puristischen Designs, die auf nichts verzichten möchten.\n\nVerleihe deinem Garten, Balkon oder Terrasse mit dem Square Stapelsessel in Grau einen Hauch von Raffinesse und genieße langlebigen Komfort in jedem Moment.'),(23,'T50304','Cortina Hocker | Natürliche Eleganz\n\nSchlichte Raffinesse | Der Cortina Hocker besticht durch seinen natürlichen Charme und die edle Kombination aus erdigen Sandstone-Tönen und einem eleganten Gestell in matt anthrazit. Ein stilvoller Begleiter für jedes Ambiente.\n\nLanglebigkeit | Mit einem Gestell aus leichtem Aluminium, das pulverbeschichtet und damit höchst widerstandsfähig ist, sowie robustem Polypropylen-Bezug von hoher Dichte ist der Hocker bestens für den täglichen Gebrauch gewappnet.\n\nVielfalt der Materialien | Die strapazierfähige Fläche aus Ranotex®-Gewebe trifft auf stabilisierende Armlehnen aus Aluminium – ein innovatives Zusammenspiel für höchsten Komfort und Stabilität.\n\nSorgfältig durchdacht | Komfortabler Sitz dank inkludiertem Kissen, während Edelstahl-Schrauben in schickem Silber für den nötigen Halt sorgen und die schützenden Fußkappen aus unauffälligem schwarzen Kunststoff sanft zu Ihrem Boden sind. \n\nErschaffen Sie mit dem Cortina Hocker eine Oase der Entspannung und überzeugen Sie sich von seiner beständigen Qualität und seinem zeitlosen Design.'),(24,'U23435','Corido Dining Move taupe | Stilvoll und Funktional\n\nModernes Design | Das Gestell des Corido Dining Move in einem eleganten Anthrazit vereint Leichtigkeit und Stabilität durch sein Aluminium-Material. Es bietet eine ansprechende, moderne Optik, die jeden Außenbereich aufwertet.\n\nLanglebige Eleganz | Die Sitzflächen aus hochwertigem Gardino®-Geflecht in edlem Charcoal Grey sind nicht nur optisch ansprechend, sondern auch extrem langlebig und komfortabel. Perfekt, um stilvoll zu entspannen.\n\nWetterfeste Konstruktion | Dank der pulverbeschichteten Behandlung ist das Gestell bestens gegen Witterungseinflüsse gewappnet. Aluminiumarmlehnen, ebenfalls pulverbeschichtet, sind robust und pflegeleicht, und bieten zusätzlichen Schutz vor den Elementen.\n\nHochwertige Details | Der Einsatz von korrosionsbeständigem Edelstahl für die Schrauben in glänzendem Silber sowie schützenden Kunststoff-Fußkappen in unauffälligem Schwarz sorgt für eine lange Lebensdauer und verlässliche Stabilität des Möbelstücks.\n\nMinimalistisch Komfortabel | Mit seinem minimalistischen Design durch den Verzicht auf Kissen bietet der Corido Dining Move eine pure und zurückhaltende Eleganz, die perfekt zu modernen Wohnstilen passt.\n\nErlebe die Verbindung von Premium-Materialien und durchdachtem Design, die nicht nur jeden Anlass aufwerten, sondern auch langlebige Freude im Freien garantieren.'),(25,'U23435','Corido Dining Move Taupe | Stil, Eleganz und Komfort vereint\n\nElegantes Design | Mit seinem anthrazitfarbenen, pulverbeschichteten Aluminiumgestell bietet der Corido Dining Move Taupe nicht nur einen stabilen Unterbau, sondern auch eine zeitlose Eleganz, die sich perfekt in jedes Ambiente einfügt. Die stilvollen Armlehnen aus dem gleichen Material und in derselben Farbe fügen sich harmonisch ins Gesamtbild ein.\n\nRobust und Wetterfest | Die halbrunde Fläche aus Gardino®-Geflecht in modernem charcoal grey ist nicht nur ein Blickfang, sondern auch extrem robust und wetterfest. Selbst unter anspruchsvollen Witterungsbedingungen bleibt dieses Möbelstück ein zuverlässiger Begleiter auf Ihrer Terrasse.\n\nMinimalistisch und Praktisch | Der Verzicht auf Kissen betont das minimalistische Design des Corido Dining Move Taupe, während die flexiblen und unauffälligen Kunststoff-Fußkappen in schwarz für standsicheren Halt sorgen.\n\nRostfreie Details | Die silber glänzenden Edelstahl-Schrauben setzen dezente Akzente und bieten hervorragenden Schutz vor Korrosion, damit Ihr Möbelstück lange in neuem Glanz erstrahlt.\n\nSichern Sie sich jetzt den Corido Dining Move Taupe und genießen Sie ein langlebiges und stilvolles Möbelstück, das jeden Anlass zu etwas Besonderem macht.'),(26,'U23435','Erlebe stilvolles Outdoor-Design mit dem Corido Dining Move taupe!\n\nModernes Flair | Mit einem anthrazitfarbenen, pulverbeschichteten Aluminiumgestell verleiht dieser elegante Stuhl Ihrem Außenbereich einen zeitgemäßen Touch. Leicht im Gewicht und dennoch robust, ist er der perfekte Begleiter für jede Gelegenheit.\n\nZeitlose Eleganz | Die Sitzfläche aus langlebigem Gardino®-Geflecht in elegantem charcoal grey verspricht nicht nur Komfort, sondern auch eine unvergleichliche Ästhetik, die jedem Ambiente einen Hauch von Raffinesse verleiht.\n\nStilvolle Details | Die stilvollen Armlehnen in anthrazit, ebenfalls aus pulverbeschichtetem Aluminium, bieten nicht nur Haltbarkeit, sondern auch eine geschmackvolle Abrundung im Design. Die unauffälligen schwarzen Kunststoff-Fußkappen sorgen für Stabilität und schützen vor Kratzern.\n\nLanglebige Qualität | Edelstahlschrauben in glänzendem Silber verbinden die Elemente mit korrosionsbeständiger Zuverlässigkeit, sodass Sie sich auf viele Sommer im Freien freuen können.\n\nDer Corido Dining Move Stuhl vereint Funktionalität, Komfort und Stil und wird zu einem unverzichtbaren Bestandteil Ihres Outdoor-Mobiliars. Ob für entspannte Stunden im Garten oder als eleganter Akzent auf Ihrer Terrasse – dieser Stuhl ist Ihre Wahl für gehobenes Wohnen im Freien.'),(27,'T50396','Corido Lou-Sessel cha.gr.\n\nStilvoll entspannen | Der Corido Lou-Sessel ist der Inbegriff von Komfort und Eleganz für Ihren Außenbereich. Mit einem Bezug aus taupe-meliertem Polypropylen bleibt der Sessel pflegeleicht und strapazierfähig, was ihn ideal für altäglichen Gebrauch macht.\n\nLeicht und stabil | Das Gestell aus leichtem Aluminium in matt anthrazit vereint Stabilität und Wetterbeständigkeit, ohne Kompromisse beim Stil einzugehen. Perfekt, um jedem Garten eine moderne Note zu verleihen.\n\nLanglebig und pflegeleicht | Die Fläche aus robustem Gardino®-Geflecht in charcoal grey ist nicht nur ein optischer Hingucker, sondern auch besonders langlebig. Die halbrunde Ausführung sorgt für ein ästhetisches Gesamtbild.\n\nKorrosionsbeständig | Hochwertige Edelstahlschrauben in klassischem Silber garantieren eine rostfreie Verbindung, sodass der Sessel Jahr für Jahr überzeugen kann.\n\nMit dem Corido Lou-Sessel gestalten Sie Ihr Outdoor-Wohnzimmer nicht nur stilvoll, sondern auch praktisch und langlebig – für entspannten Genuss im Freien.'),(28,'T52164','Clifton Ecktisch | Teakholz & Aluminium\n\nElegant und Vielseitig | Der Clifton Ecktisch vereint modernes Design mit natürlichen Materialien. Mit seinem pulverbeschichteten Aluminiumgestell in matt anthrazit ist er nicht nur ein optisches Highlight, sondern auch überraschend leicht und langlebig – perfekt für all Ihre Ansprüche.\n\nUnverwechselbar Natürlich | Die Tischplatte aus hochwertigem Teakholz in warmen Naturtönen ist beeindruckende 12mm dick und verleiht jedem Raum eine einladende Atmosphäre. Ob Drinnen oder Draußen, dieser Tisch fügt sich harmonisch in jedes Ambiente ein. \n\nRobust und Sicher | Ausgestattet mit korrosionsbeständigen Edelstahlschrauben in glänzendem Silber sowie abriebfesten Kunststoff-Fußkappen in anthrazit, garantiert der Clifton Ecktisch Stabilität und Schutz auf jedem Untergrund.\n\nStil und Beständigkeit vereint | Erleben Sie die perfekte Symbiose aus stilvoller Eleganz und funktionaler Beständigkeit mit dem Clifton Ecktisch – einem wahren Meisterwerk der handwerklichen Kunst.'),(29,'T91235','**Silva Tisch | Keramik washed grey**\n\nElegantes Design | Der Silva Tisch besticht mit einem stabilen Gestell aus pulverbeschichtetem Aluminium in modernem matt anthrazit. Diese elegante Farbgebung fügt sich nahtlos in jeden Außenbereich ein und bietet eine stilvolle Basis für gesellige Runden.\n\nModern und Widerstandsfähig | Die Tischplatte aus Keramik in trendigem washed grey verbindet modernes Design mit robuster Funktionalität. Sie ist kratzfest und witterungsbeständig, ideal für die Nutzung unter freiem Himmel – sei es bei Regen oder Sonnenschein.\n\nRobuste Konstruktion | Die Verbindung von rostfreien Edelstahl-Schrauben in glänzendem Silber und langlebigen Kunststoff-Fußkappen in unauffälligem Schwarz gewährleistet eine stabile und widerstandsfähige Struktur. So bleibt der Tisch über Jahre hinweg eine zuverlässige Wahl für Ihren Außenbereich.\n\nGenießen Sie stilvolle Abende, umgeben von modernem Design und stabiler Konstruktion – der Silva Tisch ist die perfekte Ergänzung für Ihr Zuhause! '),(30,'T52166','Clifton Beistelltisch | Modernes Design trifft auf natürliche Eleganz\n\nLeicht und Stilvoll | Der Clifton Beistelltisch beeindruckt mit einem leicht zu transportierenden Aluminiumgestell in stilvollem, mattem Anthrazit. Durch die pulverbeschichtete Behandlung ist er besonders haltbar und widerstandsfähig gegen äußere Einflüsse.\n\nErdig und Edel | Die Tischplatte aus edlem Teakholz, 12mm stark in natürlichem Finish, verleiht Ihrem Gartenambiente eine erdige und zugleich luxuriöse Note. Sie ist langlebig und perfekt geeignet für den Einsatz im Freien.\n\nKorrosionsbeständig und Elegant | Hochwertige Edelstahlschrauben in elegantem Silber verbinden die Konstruktion und machen das Möbelstück besonders beständig gegen Witterungseinflüsse.\n\nSchützend und Harmonisch | Die robusten Kunststoff-Fußkappen in harmonischem Anthrazit schützen Ihre Terrassenoberflächen und garantieren einen festen Stand.\n\nDieser moderne Beistelltisch ist die perfekte Ergänzung für jeden Outdoor-Bereich und verbindet funktionale Eleganz mit einem natürlichen, zeitlosen Design.'),(31,'T50302','**Cortina Hocker | Eleganz trifft auf Funktionalität**\n\nStilvoll im Design | Der Cortina Hocker vereint ein elegantes Design in blau-grau mit einem modernen, matt anthrazitfarbenen Gestell. Perfekt, um jedem Raum einen Hauch von Raffinesse zu verleihen.\n\nRobust und Witterungsbeständig | Das Aluminiumgestell ist nicht nur leicht, sondern dank der Pulverbeschichtung auch wetterfest. So hält der Hocker problemlos verschiedenen Witterungseinflüssen stand und bleibt Ihnen treu.\n\nKomfort bis ins Detail | Ausgestattet mit einem komfortablen Sitzkissen lädt der Hocker zum Verweilen ein. Die atmungsaktive Ranotex®-Gewebefläche sorgt für ein angenehmes Sitzgefühl, während die stabilen Aluminium-Armlehnen zusätzlichen Komfort bieten.\n\nLanglebige Materialien | Der Bezug aus pflegeleichtem Polypropylen mit einer Dichte von 275 g/m² verspricht Langlebigkeit und Robustheit. Die korrosionsbeständigen Edelstahlschrauben in glänzendem Silber sichern die Konstruktion und unterstreichen das hochwertige Design.\n\nSchützend und Unauffällig | Die unauffälligen, schwarzen Kunststoff-Fußkappen schützen den Boden und geben dem Hocker einen modernen Look.\n\nVielseitig einsetzbar und langlebig | Ob im Wohnzimmer, auf der Terrasse oder im Wintergarten – der Cortina Hocker ist ein stilvoller Begleiter, der Funktionalität mit zeitlosem Design verbindet.'),(32,'U24467','**TESSIN Bankauflage | Grau-neutral**\n\n**Komfortabel & Dekorativ** | Die TESSIN Bankauflage wurde speziell für die SIENA GARDEN Bank entwickelt und beeindruckt durch ihr farbenfrohes und dekoratives Design auf einem attraktiven grauen Bezug. Sie sorgt für zusätzlichen Komfort dank komfortablem vliesummanteltem Schaumstoff und verleiht Ihrer Gartenbank ein stilvolles Erscheinungsbild.\n\n**Pflegeleicht & Praktisch** | Der Bezug besteht aus einem strapazierfähigen Baumwoll/Polyester-Gemisch, das in einem eleganten Grau bedruckt ist. Der Stoff ist nicht abziehbar, aber handwaschbar, was ihn besonders pflegeleicht macht – ideal für den Außenbereich.\n\nMit der TESSIN Bankauflage können Sie Ihre Gartenmomente noch mehr genießen, egal ob beim Kaffee am Morgen oder beim Grillabend unter Freunden. Schaffen Sie Ihre kleine Wohlfühloase mit einem Hauch von Komfort und Stil.'),(33,'P38905','Elegant und robust zugleich – der Sincro Dining Tisch verwandelt jeden Essbereich in eine moderne Oase. \n\n**Stilvoll und langlebig** | Der Sincro Dining Tisch besticht durch sein pulverbeschichtetes Gestell aus Aluminium in matt anthrazit. Diese Kombination aus Eleganz und Stabilität macht ihn zur perfekten Wahl für jedes stilbewusste Zuhause. \n\n**Modernes Design** | Die Tischplatte aus kratzfester Keramik in einem modernen washed grey schafft nicht nur einen eleganten Look, sondern bietet auch höchste Widerstandsfähigkeit gegen alltägliche Beanspruchungen.\n\n**Wetterfest und stabil** | Rostfreie Edelstahlschrauben in glänzendem Silber und schwarz unauffällige Kunststoff-Fußkappen sichern nicht nur dauerhaften Schutz, sondern sorgen auch für einen stabilen Stand. Dieses Design ist optimal für langlebigen Einsatz konzipiert.\n\n**Perfekte Vielseitigkeit** | Mit seinem großzügigen Maß von 200x100 cm bietet der Tisch ausreichend Platz für gesellige Zusammenkünfte und stilvolle Abendessen im Freien oder in Ihrem Esszimmer.\n\nErleben Sie die perfekte Kombination aus Design und Funktionalität mit dem Sincro Dining Tisch – für ein Ambiente, das keine Wünsche offenlässt!'),(34,'M29424','Silva Tisch 220x100cm | Keramik wood-grey\n\nZeitlos modern | Der Silva Tisch präsentiert sich in stilvollem Design mit einem pulverbeschichteten Aluminiumgestell in matt anthrazit, das in jedem Raum Akzente setzt. Als gelungene Verschmelzung von Eleganz und Zweckmäßigkeit vermittelt dieser Tisch ein modernes und zugleich wohnliches Ambiente.\n\nFederleicht stabil | Gefertigt aus hochwertigem Aluminium, bleibt das Gestell trotz seiner Leichtigkeit stabil und widerstandsfähig. Die robuste Pulverbeschichtung gewährleistet Langlebigkeit und Beständigkeit gegen die Elemente, während die edel in silber gehaltenen Edelstahlschrauben jedem Deckenelement einen eleganten Touch verleihen.\n\nNatürlich widerstandsfähig | Die rechteckige Tischplatte aus langlebiger Keramik in wood grey verbindet natürliche Ästhetik mit extremer Strapazierfähigkeit. Mit einer Stärke von 10mm trotzt sie den Herausforderungen des Alltags und ist kratzresistent – ideal, um auch draußen im Garten oder auf der Terrasse einen optimalen Einsatz zu finden.\n\nSchutzvoller Komfort | Der Silva Tisch wird durch kunststoffene Fußkappen in neutralem Schwarz vollendet, die nicht nur Schutz bieten, sondern auch elegant wirken. Sie sorgen für einen festen Stand ohne unerwünschte Kratzer auf empfindlichen Untergründen.\n\nMit dem Silva Tisch 220x100cm erhältst du ein wahres Meisterwerk der Tischkultur, das nicht nur durch sein Design besticht, sondern auch durch kompromisslose Funktionalität und Langlebigkeit – die perfekte Wahl für jeden stilvollen Lebensraum.'),(35,'T52165','Clifton Ecktisch | Sinter Stone\n\nEleganz und Leichtigkeit | Der Clifton Ecktisch besticht durch sein matt anthrazit pulverbeschichtetes Aluminiumgestell, das nicht nur ein ästhetisches Highlight in jedem Raum setzt, sondern auch durch seine Leichtigkeit überzeugt. Lassen Sie Ihren Wohnbereich in neuem Glanz erstrahlen!\n\nSchutz und Beständigkeit | Die Tischplatte aus robustem, dunkelgrauem gesintertem Stein ist nicht nur edel und widerstandsfähig, sondern auch perfekt für alle Herausforderungen des Alltags gewappnet. Ergänzt wird der Tisch durch glänzende Edelstahlschrauben, die Korrosion keine Chance lassen.\n\nSanft und Unaufdringlich | Dank stoßdämpfenden Kunststoff-Fußkappen in unaufdringlichem Anthrazit bleiben Ihre Böden makellos geschützt. Der Clifton Ecktisch verbindet stilvolle Raffinesse mit praktischer Langlebigkeit, ideal für Innenräume und überdachte Außenbereiche. \n\nSetzen Sie ein Statement mit dem Clifton Ecktisch – ein unverzichtbares Stück für moderne Stilbewusste und Designliebhaber!'),(36,'T52166','Clifton Beistelltisch | FSC-zertifiziert\n\nElegant & Leicht | Der Clifton Beistelltisch besticht durch sein modernes Design und die matt anthrazit pulverbeschichteten Aluminiumbeine. Dieses hochwertige Gestell verleiht dem Tisch nicht nur eine zeitlose Eleganz, sondern macht ihn auch außergewöhnlich leicht und mühelos transportierbar.\n\nZeitlos & Widerstandsfähig | Die Tischplatte aus natürlichem Teakholz mit einer Stärke von 12mm sorgt für eine widerstandsfähige und langlebige Oberfläche, die jedem Raum oder Garten das gewisse Etwas verleiht. Dieses edle Material trotzt den Elementen und bleibt über Jahre hinweg schön.\n\nRobust & Sicher | Die stilvollen Fußkappen aus anthrazitfarbenem Kunststoff bieten nicht nur schützenden Halt, sondern bewahren auch empfindliche Oberflächen vor Kratzern. Silberne Edelstahlschrauben garantieren Korrosionsbeständigkeit und ergänzen das Gesamtbild mit einem dezenten Glanz.\n\nDer neue Clifton Beistelltisch ist die perfekte Kombination aus Funktionalität und edlem Design – ein wahres Highlight für drinnen und draußen!'),(37,'T88501','Catania Tisch | Dark Concrete\n\nEleganz trifft Leichtigkeit | Der Catania Tisch begeistert durch sein elegantes teaklook-Gestell, das aus hochwertigem Aluminium gefertigt ist. Dank dieses leichten Materials lässt sich der Tisch mühelos umstellen und flexibel einsetzen. Seine universelle Farbe passt zu jedem Ambiente und verleiht Ihrem Außenbereich eine edle Note. \n\nModerner Minimalismus | Die stilvolle Tischplatte aus Glas fasziniert durch ihr modernes dark concrete Finish. Mit einer Stärke von 5mm und der Keramikpulver Beschichtung ist sie nicht nur robust, sondern auch resistent gegen Kratzer. Egal ob Sonne, Regen oder Frost – die Catania Tischplatte hält dem Wetter souverän stand.\n\nLanglebige Komponenten | Das folierte Aluminiumgestell sorgt für besondere Langlebigkeit, während die korrosionsbeständigen Edelstahlschrauben in glänzendem Silber für Stabilität und Eleganz sorgen. Die Tischkonstruktion wird durch bodenschonende, schwarze Kunststofffußkappen perfektioniert, die Ihren Untergrund schützen und universell einsetzbar sind.\n\nHolen Sie sich mit dem Catania Tisch das perfekte Zusammenspiel aus Stabilität und Stil für Ihren Garten oder Ihre Terrasse und erleben Sie die neue Dimension von modernem Outdoor-Design.'),(38,'T52164','**Clifton Ecktisch | FSC-zertifiziert**\n\nElegante Leichtigkeit | Der Clifton Ecktisch vereint modernes Design mit rustikalem Charme. Das pulverbeschichtete Alugestell in subtil mattiertem Anthrazit besticht durch seine ästhetische Eleganz und mühelose Leichtigkeit. \n\nLanglebig und robust | Die Teakholz-Tischplatte in natürlicher Optik ist nicht nur stabil und witterungsbeständig, sondern verleiht jedem Raum ein gemütliches, rustikales Ambiente. Die 12mm starke Platte hält allen Alltagsbelastungen stand und bietet einen erdigen Kontrast zum modernen Gestell.\n\nKorrosionsbeständig | Hochwertige Edelstahlschrauben in stilvollem Silber gewährleisten eine dauerhafte und korrosionsbeständige Verbindung - somit bleibt der Tisch stets standfest und sicher.\n\nSchützende Details | Unauffällige anthrazitfarbene Fußkappen aus kratzfestem Kunststoff schützen jeden Bodenbelag und runden das durchdachte Gesamtdesign ab.\n\nDer Clifton Ecktisch ist die perfekte Ergänzung für stilvolle Innen- und Außenbereiche. Setze auf Design und Qualität und genieße dein Zuhause noch mehr!'),(39,'P38906','Sincro Tisch | Keramik wood-grey  \nStilvoll und zeitgemäß | Der Sincro Tisch ist ein Statement zeitloser Eleganz und modernem Design. Das Gestell in matt anthrazit besteht aus leichtem und wetterbeständigem Aluminium und wurde pulverbeschichtet für extra Langlebigkeit. \n\nNaturnaher Look | Die Tischplatte aus 10 mm starker Keramik in wood grey verleiht diesem Tisch einen natürlichen, stilvollen Charakter. Diese robuste Oberfläche ist perfekt für den täglichen Gebrauch und resistent gegen Kratzer und Witterungseinflüsse.\n\nPraktischer Schutz | Die stabilisierenden Fußkappen aus unauffälligem schwarzen Kunststoff schützen nicht nur deine Böden, sondern sorgen auch für ein sicheres Stehen des Tisches auf jedem Untergrund.\n\nBewährte Langlebigkeit | Die Schrauben aus glänzendem, rostfreiem Edelstahl verbinden das Gestell sicher und stabil. Diese qualitativ hochwertigen Materialien garantieren dir jahrelange Freude an deinem neuen Lieblingsstück.\n\nMit dem Sincro Tisch in deiner Einrichtung entscheidest du dich für Funktionalität gepaart mit purer ästhetischer Raffinesse. Ideal für gesellige Abende oder stilvolle Dinnerpartys – dieser Tisch ist die perfekte Ergänzung für jeden modernen Wohnraum.'),(40,'R07994','**Roma Lounge Set, 3-teilig | Eleganz trifft auf Funktionalität**\n\nStilvolle Leichtigkeit | Das Roma Lounge Set erstrahlt in einer harmonischen Farbkomposition von neutralem Grau und elegantem Matt-Anthrazit. Das Gestell aus leichtem Aluminium sorgt nicht nur für eine moderne Optik, sondern auch für eine einfache Handhabung und Langlebigkeit dank der hochwertigen Pulverbeschichtung.\n\nRobust und Komfortabel | Der Bezug aus strapazierfähigem Polypropylen mit einer Dichte von 280 g/m² verspricht langanhaltenden Komfort und Widerstandsfähigkeit. Inklusive sind bequeme Sitz- und Rückenkissen, die den Komfort auf ein neues Level heben. Genießen Sie entspannte Stunden mit Stil!\n\nWetterfest und Raffiniert | Die Oberfläche aus Gardino®-Geflecht mit ihrer klassischen, natürlichen Anmutung ist nicht nur ein optischer Hingucker, sondern auch wasserabweisend und somit prädestiniert für den Außenbereich. Dieses Set trotzt den Elementen und bleibt Ihnen viele Saisons ein treuer Begleiter.\n\nHochwertige Materialien | Die schicken Armlehnen aus pulverbeschichtetem Aluminium in matt Anthrazit werden mit warmen Onlays aus nachhaltigem FSC® 100% Teakholz kombiniert – für ein stilvolles und zugleich umweltbewusstes Design. Edelstahl-Schrauben in glänzendem Silber runden die Eleganz ab und bieten Schutz vor Rost.\n\nDezente Details | Fußkappen aus stabilem, unauffälligem schwarzem Kunststoff schützen nicht nur Ihren Boden, sondern sorgen auch für maximale Standfestigkeit.\n\nDas Roma Lounge Set – Ihre Einladung, Momente der Entspannung in einem stilvollen Ambiente zu genießen! Perfekt für jeden, der Design, Komfort und Funktionalität in vollen Zügen erleben möchte.'),(41,'R15574','Square Stapelstuhl | Taupe\n\nZeitlos elegant | Der Square Stapelstuhl in Taupe kombiniert Eleganz und Bequemlichkeit. Sein edles Gestell aus Polypropylen ist in einer eleganten Taupe-Farbe gehalten und perfekt für jedes Ambiente geeignet.\n\nUnvergleichlich robust | Durch die glasfaserverstärkte Behandlung ist das Gestell ausgesprochen stabil und langlebig. Dieser Stuhl ist dafür gedacht, Ihnen über lange Zeit hinweg ein zuverlässiger Begleiter zu sein.\n\nSchützend und unauffällig | Die transparenten Fußkappen aus Kunststoff bieten sanften Schutz für alle Bodenflächen. Sie sind so konstruiert, dass sie sanft und unauffällig jedem Raum Charme verleihen, ohne Spuren zu hinterlassen.\n\nMinimalistisches Design | Ganz ohne zusätzliche Kissen strahlt dieser Stuhl pure Schlichtheit und Zurückhaltung aus. Sein minimalistisches Design integriert sich perfekt in jede Umgebung und setzt stilvolle Akzente in Ihrem Wohn- oder Gartenbereich.\n\nDieser Square Stapelstuhl ist die ideale Wahl für alle, die auf der Suche nach einem funktionalen und zugleich stilvollen Möbelstück sind. Erlebe zeitlose Qualität und modernes Design in einem einzigen Produkt!'),(42,'R07994','Roma Lounge Set, 3-teilig\n\nStilvoll komfortabel | Mit dem eleganten Roma Lounge Set in schickem Grau schaffen Sie eine Oase der Entspannung in Ihrem Außenbereich. Dank der inklusiven Sitz- und Rückenkissen genießen Sie höchsten Komfort bei jedem Lounge-Abend.\n\nModern & Langlebig | Das moderne Gestell aus leichtem Aluminium in matt anthrazit ist pulverbeschichtet und verspricht eine dauerhafte Wetterbeständigkeit. Das hochwertige Gardino®-Geflecht in natürlicher Optik rundet das stilvolle Design perfekt ab und sorgt für ein ästhetisches Ambiente.\n\nPflegeleicht & Robust | Der Bezug aus robustem Polypropylen mit einer Materialdichte von 280 g/m² ist nicht nur langlebig, sondern auch besonders pflegeleicht. Erhalten Sie die edle Optik Ihres Lounge Sets mit minimalem Aufwand.\n\nNachhaltig & Strapazierfähig | Die Armlehnen bestechen durch eine Kombination aus pulverbeschichtetem Aluminium und warmem Teakholz, FSC® 100% zertifiziert, für einen nachhaltigen und strapazierfähigen Look. Die dezenten, schwarzen Fußkappen aus Kunststoff schützen Ihre Bodenbeläge zuverlässig.\n\nPerfekt abgestimmt | Die silbernen, rostfreien Edelstahlschrauben fügen sich nahtlos in das zeitlose Design ein und versprechen besondere Beständigkeit. Verleihen Sie Ihrem Outdoor-Bereich einen Hauch von Eleganz und Modernität – mit dem Roma Lounge Set, Ihrer Zuflucht zum Wohlfühlen und Entspannen im Freien.'),(43,'F13669','### Bio-Anzuchttöpfe | Rundum nachhaltig & praktisch\n\n**Fördert optimales Wachstum** | Unsere quadratischen Bio-Anzuchttöpfe mit einem Durchmesser von 5 cm bieten die ideale Umgebung für Ihre Jungpflanzen. Sie sind perfekt für die Anzucht von Gemüse, Kräutern und Blumen und fördern ein gesundes Wurzelwachstum, sodass Ihre Pflanzen von Beginn an stark und widerstandsfähig heranwachsen.\n\n**100% biologisch abbaubar** | Die Töpfe bestehen aus natürlichen Materialien und sind vollständig kompostierbar. Das bedeutet, dass Sie sie einfach mitsamt der Pflanze in den Boden einpflanzen können, ohne den Wachstumsprozess zu unterbrechen – für eine umweltfreundliche Gartenarbeit ohne Plastikabfall.\n\n**Platzsparendes Design** | Dank ihrer quadratischen Form lassen sich die Töpfe dicht aneinander reihen, was den verfügbaren Platz optimal ausnutzt. Ob auf dem Balkon, der Terrasse oder im Gewächshaus – Sie können auf kleinem Raum eine Vielzahl an Pflanzen ziehen.\n\nEntdecken Sie die perfekte Balance zwischen Nachhaltigkeit und Praktikabilität mit unseren Bio-Anzuchttöpfen, die Ihre Gartenarbeit revolutionieren werden! Machen Sie Ihren grünen Daumen glücklich und pflanzen Sie mit gutem Gewissen!'),(44,'R07994','**Roma Lounge Set | Stilvolle Eleganz trifft auf modernen Komfort**\n\nZeitloses Design | Das Roma Lounge Set bringt mit seiner neutralen grauen Bezugsfarbe und dem modernen matt anthrazitfarbenen Gestell einen Hauch von sophisticated Chic in Ihren Außenbereich. Aus leichtem Aluminium gefertigt, ist das Set sowohl ästhetisch ansprechend als auch praktisch für Ihre Outdoor-Oase.\n\nHerausragende Strapazierfähigkeit | Der Bezug aus Polypropylen mit einer Materialdichte von 280 g/m² ist nicht nur besonders robust, sondern auch unglaublich strapazierfähig – ideal für jede Wetterlage und den täglichen Gebrauch. Das einzigartige Gardino®-Geflecht in natürlicher Flächenfarbe sorgt für ein einladendes Ambiente.\n\nLuxuriöser Komfort | Inklusive weich gepolsterten Sitz- und Rückenkissen bietet das Set höchstmöglichen Komfort für entspannte Stunden im Freien. Die eleganten Armlehnen aus pulverbeschichtetem Aluminium, kombiniert mit warmen Onlays aus FSC® 100% zertifiziertem Teakholz, vervollständigen den exklusiven Look des Sets.\n\nWiderstandsfähigkeit auf höchstem Niveau | Das Gestell, robust und stabil aus pulverbeschichtetem Aluminium, weist eine exzellente Widerstandsfähigkeit gegen jegliche Witterungseinflüsse auf. Edelstahlschrauben in glänzendem Silber garantieren Langlebigkeit ohne Rostprobleme, während die unauffälligen schwarzen Fußkappen aus Kunststoff Ihre Böden schützen.\n\nWählen Sie das Roma Lounge Set für eine harmonische Verbindung von natürlichem Flair und modernem Design – für Ihren perfekten Rückzugsort im Freien. Gestalten Sie mit diesem einmaligen Set unvergessliche Momente unter freiem Himmel.'),(45,'P38905','Sincro Dining Tisch | Edler Minimalismus trifft auf Funktionalität\n\nZeitlose Eleganz | Der Sincro Dining Tisch bietet eine perfekte Kombination aus hochwertigem Design und Funktionalität. Das matt anthrazit pulverbeschichtete Aluminiumgestell verleiht dem Tisch eine elegante und moderne Ausstrahlung, die sich nahtlos in jedes Ambiente einfügt.\n\nRobust und Leicht | Mit seinem leichten Aluminiumgestell ist der Sincro Dining Tisch nicht nur einfach zu handhaben, sondern auch überaus robust. Die pulverbeschichtete Oberfläche sorgt für zusätzliche Langlebigkeit und Widerstandsfähigkeit gegen äußere Einflüsse.\n\nStilvolle Langlebigkeit | Die Tischplatte aus widerstandsfähiger Keramik in washed grey besticht durch ihren stilvollen Look und ihre 10 mm starke, hochwertige Verarbeitung. Diese sorgt für eine nachhaltige Nutzung und eine ausgezeichnete Resistenz gegen Kratzer und Witterungseinflüsse.\n\nUnauffällig Schützend | Unauffällige, schwarze Kunststofffußkappen schützen Ihren Boden und sorgen für Stabilität, ohne das stilvolle Erscheinungsbild des Tisches zu beeinträchtigen. Die glänzenden Edelstahlschrauben in Silber bieten nicht nur korrosionsbeständige Funktionalität, sondern setzen auch dezente, elegante Akzente.\n\nPerfektion in jedem Detail | Der Sincro Dining Tisch ist mehr als nur ein Möbelstück – er ist ein verlässlicher und stilvoller Begleiter für Ihre Feiern, Dinnerpartys oder ruhigen Sonntagnachmittage. Verleihen Sie Ihrem Essbereich das harmonische Zusammenspiel von Design und Funktion, das nur der Sincro Tisch bieten kann.'),(46,'M29423','**Sincro Ausziehtisch | Keramik wood grey**\n\n**Flexibel erweiterbar |** Mit dem ausgeklügelten Synchron-Ausziehmechanismus lässt sich unser Sincro Ausziehtisch mit nur einem Handgriff bequem von 2,00 m auf 2,60 m verlängern. So sind Sie bestens auf spontane Gäste vorbereitet und können unvergessliche Momente im Freien genießen.\n\n**Zeitlos stilvoll |** Die elegante Kombination aus dem Gestell in modernem, matt anthrazit gehaltenem Aluminium und der Tischplatte in stilvollem wood grey versprüht zeitlose Eleganz und Raffinesse. Der pulverbeschichtete Rahmen sorgt für ein langlebiges und qualitativ hochwertiges Erscheinungsbild.\n\n**Hoch belastbar |** Die widerstandsfähige Keramikplatte trotzt den täglichen Herausforderungen: Sie ist kratzresistent, UV-beständig und witterungsresistent – ideal für den Innen- und Außeneinsatz. Ob strahlender Sonnenschein oder Regen, der Sincro Ausziehtisch bleibt Ihnen treu.\n\n**Pflegeleicht und sicher |** Die unauffälligen, schwarzen Kunststoff-Fußkappen schützen Ihre Böden und sorgen für einen sicheren Stand. Dank der korrosionsbeständigen Edelstahlschrauben in schickem Silber bleibt auch die Montage dauerhaft stark und stabil.\n\n**Leicht und robust |** Trotz seines leichten Aluminiumgestells bietet der Tisch immense Stabilität. Kein unnötiger Ballast, sondern elegantes Design trifft praktisch leichte Handhabung – perfekt, um das Beste aus Ihrem Wohn- und Lebensraum herauszuholen.\n\nVerleihen Sie Ihrem Outdoor-Bereich einen Hauch von Klasse und Funktionalität mit dem Sincro Ausziehtisch in Keramik wood grey – der perfekte Begleiter für stilvolle Zusammenkünfte und genussvolle Stunden im Freien!'),(47,'R07994','Roma Lounge Set | Dreiteilig und stilvoll\n\nZeitlos elegant | Willkommen zu einem luxuriösen Entspannungserlebnis mit dem Roma Lounge Set in edlem Grau. Sein Bezug aus Polypropylen mit einer Dichte von 280 g/m² verspricht Strapazierfähigkeit und ist pflegeleicht. Perfekt für lange Abende unter freiem Himmel.\n\nLeicht und modern | Das Gestell aus Aluminium in modernem matt Anthrazit vereint Leichtigkeit mit Stabilität. Dank der Pulverbeschichtung ist es besonders widerstandsfähig gegen Umwelteinflüsse und langlebig im Gebrauch.\n\nHarmonischer Look | Die Flächen aus Gardino®-Geflecht in natürlichem Beige fügen sich perfekt in jede Umgebung ein. Dieses elegante Geflecht verleiht deinem Außenbereich eine neutrale und dennoch attraktive Anziehungskraft.\n\nKomfort und Stil | Im Set inbegriffen sind komfortable Sitz- und Rückenkissen, die dir luxuriösen Komfort bieten. Die stilvoll matten Armlehnen aus Aluminium sind pulverbeschichtet und durch ihre Teakholz-Elemente mit FSC® 100% Zertifikat nachhaltig und warm in ihrer Ausstrahlung.\n\nKorrosionsbeständige Details | Hochwertige Edelstahlschrauben in glänzendem Silber und unauffällige, rutschfeste Fußkappen aus schwarzem Kunststoff ergänzen das Set für eine rundum harmonische und langlebige Nutzung.\n\nMach es dir mit dem Roma Lounge Set gemütlich und setze ein stilvolles Highlight in deinem Garten oder auf der Terrasse. Eleganz trifft auf Funktionalität – bereit, dein Outdoor-Moment zu verwandeln!'),(48,'P37184','**Sincro 200/260x100 Teak | Der perfekte Outdoor-Partner**\n\nModern Eleganz | Mit einem stilvollen Gestell aus pulverbeschichtetem Aluminium in matt anthrazit vereint der Sincro Teak Tisch modernes Design mit erstklassiger Funktionalität. Er ist leicht und dennoch langlebig, ideal für jeden Anlass.\n\nNatürliche Wärme | Die Tischplatte aus FSC® 100% zertifiziertem Teakholz in einem warmen Naturton sorgt für eine einladende Atmosphäre. 10mm stark und rechteckig, bietet sie Stabilität bei gleichzeitig nachhaltigem Charme.\n\nLangfristige Beständigkeit | Hochwertige Edelstahl-Schrauben in glänzendem Silber garantieren Rostfreiheit und Langlebigkeit. Die dezenten schwarzen Fußkappen aus Kunststoff schützen Ihre Bodenbeläge sanft und zuverlässig.\n\nZeitloser Luxus | Mit dem Sincro Teak Tisch verleihen Sie Ihrem Außenbereich eine Note von zeitlosem Luxus. Ob für ein gemütliches Frühstück oder stilvolle Abendessen unter freiem Himmel – dieser Tisch ist die perfekte Ergänzung für Ihren Garten.'),(49,'T52165','Clifton Ecktisch | s.stone\n\nElegante Leichtigkeit | Das pulverbeschichtete Aluminiumgestell in matt anthrazit vereint stilvolle Eleganz mit bemerkenswerter Leichtigkeit. Dank der robusten Konstruktion bleibt der Ecktisch auch bei häufigem Gebrauch stabil und behält seine ansprechende Optik über Jahre hinweg.\n\nModerne Beständigkeit | Die Tischplatte aus dunkelgrauem gesintertem Stein begeistert durch ihre Langlebigkeit und Widerstandsfähigkeit. Sie hält den täglichen Herausforderungen mühelos stand und behält ihren modernen, edlen Look – perfekt für drinnen und draußen!\n\nSchützende Details | Zum Schutz empfindlicher Böden sorgen die dezenten, anthrazitfarbenen Fußkappen aus Kunststoff. Stabile, rostfreie Edelstahlschrauben in glänzendem Silber fügen sich nahtlos in das Gesamtbild ein und garantieren sichere und dauerhafte Befestigung.\n\nBereichern Sie Ihren Wohnraum mit dem Clifton Ecktisch – eine Symbiose aus Design, Qualität und Funktionalität, die jeden Raum aufwertet!'),(50,'R15574','**Square Stapelstuhl | Taupe**\n\nStilvoll stapelbar | Der Square Stapelstuhl in taupe vereint Funktionalität mit minimalistischer Eleganz. Dank seines leichten Gew